        </SwiperSlide>
        <SwiperSlide>
          <img src={HOC} alt="" />
        </SwiperSlide> */}
        <SwiperSlide>
          <img src={Flejob} alt="" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Kidmapa} alt="" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Merit} alt="" />
        </SwiperSlide>
        <SwiperSlide>
          <img src={Panattasport} alt="" />
        </SwiperSlide>

      </Swiper>
    </div>
  );
};

export default Portfolio;
